import React from "react";
import "./Pagetwo.css";
import digitalanalysis from '../assets/digitalanalysis';
import { Card, CardMedia } from "@mui/material";
function Pagetwo() {
  return (
    <div className="pagetwo">
      <p style={{ fontFamily: "Open Sans", fontWeight: "700", fontSize: "16px" }}>Here how it works</p>
      <h3
        style={{ fontFamily: "Open Sans", fontWeight: "700", fontSize: "36px" }}
      >
        Simple process to start
      </h3>


      <div>
        <Card>
<CardMedia image={digitalanalysis}/>
        </Card>
      </div>
    </div>
  );
}

export default Pagetwo;
